&lt;b&gt;Battles Without Honor And Humanity&lt;/b&gt; (1973)

&quot;In the teeming black markets of postwar Japan, Shozo Hirono (Bunta Sugawara) 
and his buddies find themselves in a new war between fractious and ambitious 
yakuza. After joining boss Yamamori, Shozo is drawn into a feud with his sworn 
brother's family, the Dois. But that's where the chivalry of traditional 
yakuza film ends and the hypocrisy, betrayal, and assassinations begin. A rare 
and critical perspective on the history of Japan after World War II, BATTLES 
WITHOUT HONOR AND HUMANITY is a tour-de-force that revolutionized the yakuza 
genre and launched Kinji Fukasaku and Bunta Sugawara to international stardom.&quot;

______________________________________________________________________________


&lt;b&gt;Deadly Fight In Hiroshima&lt;/b&gt; (1973)

&quot;Repeatedly beat to a pulp by gamblers, cops, and gangsters, lone wolf Shoji 
Yamanaka (Kinya Kitaoji, who went on to star as Rhett Butler in the Tokyo stage 
version of GONE WITH THE WIND), finally finds a home as a Muraoka family hit 
man and falls in love with boss Muraoka's niece. Meanwhile, the ambitions of 
mad dog Katsutoshi Otomo (Sonny Chiba, KILL BILL) draws our series' hero, Shozo 
Hirono (Bunta Sugawara), into a new round of bloodshed, culminating with the 
tragic demise of the young Yamanka.&quot;

______________________________________________________________________________


&lt;b&gt;Proxy War&lt;/b&gt; (1973)

&quot;The successor to Hiroshima's most powerful yakuza family, the Muraokas, is 
whacked in broad daylight on a busy city street. What unfolds is a yakuza 
succession crisis, as the weaseley Uchimoto (Takeshi Kato) dithers and the slimy, 
backstabbing boss Yamamori steps in as the Muraoka's new boss. Bunta Sugawara's 
would-be independent yakuza, Shozo Hirono, is caught in the middle, having to 
play powerbroker. But the opposing factions seek support from powerful families 
in Kobe, making all out war inevitable.&quot;

______________________________________________________________________________


&lt;b&gt;Police Tactics&lt;/b&gt; (1974)

&quot;As Japan gears up for the 1964 Olympic games, the cops start to crack down under 
pressure from the public and the press, adding a new dimension in the war for 
power among the yakuza families of Hiroshima. Akira Kobayashi's Takeda tries to 
keep a lid on things, but hotheaded underlings create chaos, with one boss 
whacked in neutral territory, and the craven boss, Uchimoto, informing on an 
assassination attempt by his own minions. While the police round up hundreds of 
yakuza foot soldiers, Bunta Sugawara's Shozo Hirono plots to finally take out 
longtime nemesis, boss Yamamori&quot;

______________________________________________________________________________


&lt;b&gt;Final Episode&lt;/b&gt; (1974)

&quot;In the wake of a big police crackdown, Akira Kobayashi's icily sun- glassed 
Takeda attempts to transform the Hiroshima yakuza families into a legitimate 
political organization: The Tensei Coalition. When the young Matsumura ascends 
to the chairmanship of the coalition, the older, hardened yakuza led by Jo 
Shishido (BRANDED TO KILL) seize one last opportunity to stir up chaos and 
bloodshed. Culminating with the arrests, deaths, or retirement of the first 
postwar yakuza generation, this milestone series draws to an ambivalent close.&quot;

______________________________________________________________________________


&lt;b&gt;Bonus Supplemental Disc&lt;/b&gt; (only available with Boxed Set) includes:

1. Friedkin on Fukasaku Director William Friedkin on Fukasaku and The Yakuza Papers
2. Translating Fukasaku, an interview with subtitler Linda Hoaglund
3. Kantoku: Remembering Fukasaku, A 20-minute group discussion
4. Jitsuroku: Reinventing the Yakuza Genre, a 30-minute video essay
5. Boryoku: Fukasaku and the Art of Violence, features interviews and rare archival footage
6. Also a nice easter egg about cutting off fingertips as told by a former Yakuza member 
(with sunglasses on and his face in the dark to hide his identity).

